Patch Set 23:

> I always ignore all "go read X". Quote what you feel is important. So far you're showing that you misunderstand the topic.

thats so childish.
API clearly says:

The finalization mechanism is inherently problematic. Finalization can lead to performance issues, deadlocks, and hangs. Errors in finalizers can lead to resource leaks; there is no way to cancel finalization if it is no longer necessary; and no ordering is specified among calls to finalize methods of different objects. Furthermore, there are no guarantees regarding the timing of finalization. The finalize method might be called on a finalizable object only after an indefinite delay, if at all. Classes whose instances hold non-heap resources should provide a method to enable explicit release of those resources, and they should also implement AutoCloseable if appropriate. The Cleaner and PhantomReference provide more flexible and efficient ways to release resources when an object becomes unreachable.

Finalization may occur whenever the virtual machine detects that no reference to an object will ever be stored in the heap: The garbage collector may reclaim an object even if the fields of that object are still in use, so long as the object has otherwise become unreachable. This may have surprising and undesirable effects in cases such as the following example in which the bookkeeping associated with a class is managed through array indices. Here, method action uses a reachabilityFence to ensure that the Resource object is not reclaimed before bookkeeping on an associated ExternalResource has been performed; in particular here, to ensure that the array slot holding the ExternalResource is not nulled out in method Object.finalize(), which may otherwise run concurrently.

 class Resource {
   private static ExternalResource[] externalResourceArray = ...

   int myIndex;
   Resource(...) {
     myIndex = ...
     externalResourceArray[myIndex] = ...;
     ...
   }
   protected void finalize() {
     externalResourceArray[myIndex] = null;
     ...
   }
   public void action() {
     try {
       // ...
       int i = myIndex;
       Resource.update(externalResourceArray[i]);
     } finally {
       Reference.reachabilityFence(this);
     }
   }
   private static void update(ExternalResource ext) {
     ext.status = ...;
   }
 }
Here, the invocation of reachabilityFence is nonintuitively placed after the call to update, to ensure that the array slot is not nulled out by Object.finalize() before the update, even if the call to action was the last use of this object. This might be the case if, for example a usage in a user program had the form new Resource().action(); which retains no other reference to this Resource. While probably overkill here, reachabilityFence is placed in a finally block to ensure that it is invoked across all paths in the method. In a method with more complex control paths, you might need further precautions to ensure that reachabilityFence is encountered along all of them.
It is sometimes possible to better encapsulate use of reachabilityFence. Continuing the above example, if it were acceptable for the call to method update to proceed even if the finalizer had already executed (nulling out slot), then you could localize use of reachabilityFence:


 public void action2() {
   // ...
   Resource.update(getExternalResource());
 }
 private ExternalResource getExternalResource() {
   ExternalResource ext = externalResourceArray[myIndex];
   Reference.reachabilityFence(this);
   return ext;
 }

Patch Set 24:

> No, unlike finalize(), the Cleaner has the guarantee to run

Try this snippet:
----
import java.lang.ref.Cleaner;

public final class BugXXXXXX_Playground {
	private static class Resource
	{

	}

	// "leaks" resource without "disposing" it
	static void leakingMethod(Cleaner cleaner) {
		Resource resource = new Resource();
		cleaner.register (resource, () -> {
			System.out.println ("Cleaned!");
		});
	}

	public static void main(String[] args) {
		Cleaner cleaner = Cleaner.create ();
		leakingMethod(cleaner);

		// If this is not done, Resource is not cleaned
		// System.gc ();
	}
}
----

In this snippet, Cleaner does not clean! Contrary to your previous assertions that it's guaranteed to clean. I'm using JDK 11.0.8 if that matters.

This might give you a sense of why I'm bothered when someone quotes without understanding.

But at least you gave narrow quotes for this. No sarcasm here, narrow quotes are much easier to discuss compared to walls of text.

Patch Set 24:

> Patch Set 24:
> 
> Regarding your assertion that while '.finalize()' runs, another thread could be modifying the Resource:

I did not say "could be modifying" since there is no guarantee that a write to a non volatile handle does modify anything. 

> [2] https://docs.oracle.com/en/java/javase/17/docs/api/java.base/java/lang/ref/Reference.html#reachabilityFence(java.lang.Object)

[2] does not even contain the words "tail", "thread" you used.
An example of finalize() called while member still running:
class FinalizeThis {
    protected void finalize() {
        System.out.println("finalized!");
    }

    void loop() {
        System.out.println("loop() called");
        for (int i = 0; i < 1_000_000_000; i++) {
            if (i % 1_000_000 == 0)
                System.gc();
        }
        System.out.println("loop() returns");
        // java.lang.ref.Reference.reachabilityFence(this); // <- would solve it
    }

    public static void main(String[] args) {
        new FinalizeThis().loop();
        System.gc();
    }
}
Adapted from https://stackoverflow.com/questions/26642153/finalize-called-on-strongly-reachable-objects-in-java-8
Example works because API defines "Finalization may occur whenever .. no reference to an object .. in the *heap*" [2]
But the example does not need the heap.
